import './App.css';
import CreateTask from './Tasks/CreateTask'
import ManageTasks from './Tasks/ManageTasks'
import * as reactbootstrap from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <div className="mt-4 col-md-12 col-lg-12">
        <reactbootstrap.Row className='p-1'>
          <reactbootstrap.Col className='col-md-4'>
            <CreateTask />
          </reactbootstrap.Col>
          <reactbootstrap.Col className='col-md-4'>
            <ManageTasks />
          </reactbootstrap.Col>
        </reactbootstrap.Row>
      </div>
    </div>
  );
}

export default App;
